import MovieCard from './MovieCard';

function MoviesSearch( { movieData } ) {
    if( movieData === null ){
        console.log("ERROR!");

    } else {
        return (
            <div className="movies-container">
                {movieData.map((oneMovie, i) => <MovieCard key={i} movieObj={oneMovie}/>)}
            </div>
        )

    }
}

export default MoviesSearch;
